    [],nt"revision_timestamp": "2015-07-23T03:29:26.999465",nt"name": "fws-national-wildlife-refuge-system-wilderness-fellows-report-on-wilderness-character-moni",nt"isopen":
    false,nt"url": null,nt"notes": "In October 1971, a wilderness study was
    conducted to determine if areas of the Chassahowitzka NWR should be considered for
    wilderness designation. The report determined that although management and development
    programs on the refuge had not significantly changed most of the refuge environment,
    some of the existing activities, such as commercial crabbing, fishing, guiding,
    and motorboat use were not considered to be compatible with provisions of the Wilderness
    Act. Wilderness Character Monitoring occurred at Chassahowitzka National Wildlife
    Refuge from 22 August 2011 to 25 November 2011.  The staff at Chassahowitzka NWR
    identified 21 measures that characterize the designated wilderness area of the refuge.",nt"license_title":
